// SPDX-License-Identifier: MIT
pragma solidity >0.6.0;

/*
    
*/

library operations
{
    function add(uint a, uint b) public pure returns(uint)
    {
        uint total = a + b;
        return total;
    }

    function sub(uint a, uint b) public pure returns(uint)
    {
        require(b >= a, "LIbrary error: First v");
    }
}

